import React from 'react';
import { useSelector } from 'react-redux';


const FilterOriginElement = (props) => {
    const store = useSelector(state => state.prooductsSlice)
    return (
        <div className="originList">
            <label htmlFor="origin" className="originName">
                {props.origin.toUpperCase()}
            </label>
            <input  
                type="checkbox" 
                name={props.origin} 
                className="origin"
                onChange={(event) => props.handleCheckbox({name: event.target.name})} 
                defaultChecked={
                    store.origins.forEach(
                        element => element[0] === props.origin 
                            ? element[1] : null 
                    )}  
            />
        </div>
    )
}

export default FilterOriginElement
